package com.txdot.isd.rts.webservices.common.data;import com.txdot.isd.rts.services.data.NameAddressData;/* * RtsNameAddress.java * * (c) Texas Department of Motor Vehicles 2011 * --------------------------------------------------------------------- * Change History: * Name			Date		Description * ------------	-----------	-------------------------------------------- * D Hamilton	11/17/2011	Created class. * 							defect 10729 Ver 6.9.0 * --------------------------------------------------------------------- *//** * This lays out the data contained in an Address. * * @version	6.9.0			11/17/2011 * @author	Dan Hamilton * <br>Creation Date:		11/17/2011 11:27:06 *//* &RtsNameAddress& */public class RtsNameAddress {/* &RtsNameAddress'csName1& */	protected String csName1;/* &RtsNameAddress'csName2& */	protected String csName2;/* &RtsNameAddress'caRtsAddress& */	protected RtsAddress caRtsAddress;	/**	 * 	 *//* &RtsNameAddress.RtsNameAddress& */	public RtsNameAddress() {		super();		setRtsAddress(new RtsAddress());	}	/**	 * 	 *//* &RtsNameAddress.RtsNameAddress$1& */	public RtsNameAddress(NameAddressData nameAddressData) {		super();		if (nameAddressData.getAddressData() != null) {			setRtsAddress(new RtsAddress(nameAddressData.getAddressData()));		}		setName1(nameAddressData.getName1());		setName2(nameAddressData.getName2());	}	/**	 * @return	 *//* &RtsNameAddress.getRtsAddress& */	public RtsAddress getRtsAddress() {		return caRtsAddress;	}	/**	 * @return	 *//* &RtsNameAddress.getName1& */	public String getName1() {		return csName1;	}	/**	 * @return	 *//* &RtsNameAddress.getName2& */	public String getName2() {		return csName2;	}	/**	 * @param address	 *//* &RtsNameAddress.setRtsAddress& */	public void setRtsAddress(RtsAddress address) {		caRtsAddress = address;	}	/**	 * @param string	 *//* &RtsNameAddress.setName1& */	public void setName1(String string) {		csName1 = string;	}	/**	 * @param string	 *//* &RtsNameAddress.setName2& */	public void setName2(String string) {		csName2 = string;	}}/* #RtsNameAddress# */